import React, { Component } from 'react';
import API from './API/API';
import './App.css';

class App extends Component {
	constructor() {
		super();
		this.api = new API();
		this.state = {
			data: null,
		};
		this.api.getRandomItem().then(res => this.setState({ data: res }));
	}

	componentDidMount() {}

	render() {
		let content="Loading content";
		if (this.state.data != null) {
			content = 
      <h4>{this.state.data.title}</h4>
      Object.values(this.state.data.variables).map(v=><li>v.code</li>);
		}

		return (
			<React.Fragment>
				<h3>STATBOY</h3>
				{/* {Object.values(this.state.data).map(d=><h3 key={d.id}>{d.text}</h3>)} */}
				{content}
			</React.Fragment>
		);
	}
}

export default App;
